node	service	0	39	66	und	0	IT-avdelingen tilbyr drift (installasjon, vedlikehold og brukerstøtte) av stasjonær og bærbar datamaskin med Mac OSX.\r\n\r\nMac-klient inkluderer:\r\n- At maskinen blir satt opp med gjeldende utgave av Mac OSX\r\n- Alle nødvendige sikkerhetsinnstillinger og oppdateringer blir automatisk ivaretatt.\r\n- UiB-pålogging, dvs at bruker logger inn på maskinen med sitt vanlige UiB-brukernavn og passord. \r\n- Hjemmeområdet og nettverksskrivere (pullprint) gjøres lett tilgjengelig.\r\n- E-post settes opp automatisk.\r\n- Standard programvare og de mest brukte programmene ved ditt institutt/avdeling blir installert.\r\n- Du kan selv installere programmer fra "Managed Software Update". \r\n- På bærbare datamaskiner blir VPN og eduroam automatisk satt opp. \r\n- Brukerstøtte også utenfor universitetsområdet.\r\n\r\nVi gjør oppmerksom på følgende:\r\n- IT-avdelingens gir ikke støtte på andre oppsett eller versjoner av Mac enn den vi tilbyr\r\n- IT-avdelingen gir dessverre ikke støtte i bruk av selve programvaren.\r\n- IT-avdelingen anbefaler at bærbare maskiner blir koblet til UiB-nettverket minst en gang i måneden for å ivareta stabilitet og sikkerhet.\r\n- IT-avdelingen tilbyr bare tjenesten på utstyr kjøpt av UiB i henhold til IT-avdelingens innkjøpsanbefalinger, https://it.uib.no/Innkj%C3%B8psveiledning\r\n	plain_text
node	service	0	37	65	und	0	IT-avdelingen tilbyr drift (installasjon, vedlikehold og brukerstøtte) av stasjonær og bærbar datamaskin med Linux.\r\n\r\nLinux-klient inkluderer:\r\n- At maskinen blir satt opp med Ubuntu Linux\r\n- Alle nødvendige sikkerhetsinnstillinger og oppdateringer blir automatisk ivaretatt.\r\n- UiB-pålogging, dvs at bruker logger inn på maskinen med sitt vanlige UiB-brukernavn og passord. \r\n- På stasjonære datamaskiner gjøres hjemmeområde automatisk tilgjengelig.\r\n- Nettverksskrivere (Pullprint) og e-post settes opp automatisk.\r\n- Standard programvare og de mest brukte programmene ved ditt institutt/avdeling blir installert.\r\n- Du kan selv installere programmer fra "Software Center". \r\n- På bærbare datamaskiner blir VPN og eduroam automatisk satt opp. \r\n- Brukerstøtte også utenfor universitetsområdet.\r\n\r\nVi gjør oppmerksom på følgende:\r\n- IT-avdelingens gir ikke støtte på andre oppsett eller versjoner av Linux enn den vi tilbyr\r\n- IT-avdelingen gir dessverre ikke støtte i bruk av selve programvaren.\r\n- IT-avdelingen anbefaler at bærbare maskiner blir koblet til UiB-nettverket minst en gang i måneden for å ivareta stabilitet og sikkerhet.\r\n- IT-avdelingen tilbyr bare tjenesten på utstyr kjøpt av UiB i henhold til IT-avdelingens innkjøpsanbefalinger, https://it.uib.no/Innkj%C3%B8psveiledning\r\n	plain_text
