node	service	0	28	60	und	0	UiB tilbyr e-post til ansatte og studenter.  \r\n\r\nE-post tilbys både på maskiner driftet av IT-avdelingen (klientdriftet) og egendriftet utstyr.  På klientdriftet utstyr settes e-post vanligvis opp automatisk.  \r\n\r\nAnsatte har tilbud om e-post gjennom to ulike systemer: \r\n- For Windows- og Mac-brukere anbefaler vi Exchange/Outlook med kalenderfunksjonalitet.Du kan også bruke https://kalender.uib.no for å lese e-post, se https://tk.app.uib.no/node/44\r\n- For Linux-brukere anbefaler vi e-post via "unix e-post" gjerne med Thunderbird som e-postklient. Du kan også bruke https://webmail.uib.no for å lese e-post, se https://tk.app.uib.no/node/45\r\n \r\nFor oppsett av e-post på mobile enheter og annet egendriftet utstyr henvises det til brukerveiledninger på https://it.uib.no/E-post .\r\n\r\nAll e-post til og fra UiB scannes grundig etter virus og uønsket reklame, såkalt spam.	plain_text
