node	service	0	60	82	und	0	Mange mottakere har begrensninger på hvor stor en e-poster kan være. I tillegg blir mange e-post bokser full fordi de mottar mye e-post med store vedlegg. Med å bruke denne tjenesten kan en omgå disse problemene. \r\n\r\nDu laster opp en fil og mottar en lenke som du kan oppgi i e-posten som du ønsker å sende. Mottaker kan laste ned vedlegget via lenken.\r\n\r\nDu må ikke benytte denne tjenesten til konfidensielle data eller dokumenter.\r\n\r\nTjenesten håndterer filer størrelser på opp til 2 GB. 	plain_text
