node	service	0	69	93	und	0	STUDENTER får hjemmekatalog på et lagringsområde på en av IT-avdelingens tjenermaskiner (servere). Det er en begrensning på hvor mye plass du kan bruke på hjemmekatalogen. Hjemmekatalogen kobles automatisk opp når du logger deg på klientmaskiner på UiB. Du kan også koble til hjemmekatalogen fra andre maskiner.\r\n\r\nANSATTE får to hjemmekataloger på IT-avdelingens servere. Den ene brukes som aktivt arbeidsområde. Innholdet av denne er også tilgjengelig (synkronisert) på bærbar Windows klient. Den andre brukes som arkiv og kan ikke synkronisere til bærbar Windows klient. Det er begrensning på hvor mye plass du kan bruke på hjemmekatalogene. Begge hjemmekatalogene kobles automatisk opp når du logger deg på klientmaskiner på UiB. Du kan også koble til begge hjemmekatalogene fra andre maskiner.\r\n\r\nInnholdet på hjemmekataloger sikkerhetskopieres hver natt.	plain_text
node	service	0	51	73	und	0	Området kan brukes til å utveksle data eller en kan ha prosjektsamarbeid på tvers av enhetene. Tilgangen til prosjektområdene er begrenset. \r\n\r\nFor utveksling av data bruk Temp mappen. Vær oppmerksom på at alle med konto har tilgang til Temp mappen. Dette er kun ett temporært område og data kan bli slettet.\r\n \r\nSti til området er \\\\skuld.uib.no\\uibfelles og på Windows-klienter vil det normalt være mappet opp til N:\\	plain_text
node	service	0	71	95	und	0	Windows-klient med kiosk-oppsett brukes noen steder på UiB for å tilby enkel tilgang til visse tjenester:\r\n- Litteratur- og nettsøk i universitetsbiblioteket\r\n- Semesterregistrering for nye studenter\r\n- Enkel tilgang til nettinformasjon i infosenterene\r\n\r\nWindows-klient med kiosk-oppsett har bare installert nettleser og de mest nødvendige tillegg for å kunne gjøre ting på nettsider. Det blir ikke installert annen programvare.\r\nNoen maskiner har full tilgang til internett. Noen har bare tilgang til sider på UiB. Dette er avhengig av maskinens plassering og formål.	plain_text
node	service	0	52	74	und	0	Denne tjenesten er en variant av Windows-klient tjenesten: https://tk.app.uib.no/node/38\r\nIT-avdelingen tilbyr drift (installasjon, vedlikehold og brukerstøtte) av stasjonær datamaskin med Windows lab-oppsett med følgende begrensninger:\r\nIT-avdelingen tilbyr ikke drift (installasjon, vedlikehold og brukerstøtte) av tilkoblet utstyr, koblinger og spesialprogramvare. Drift av denne typen utstyr er det lokal-IT som har ansvar å drifte og gi brukerstøtte på.\r\n\r\nWindows-klient inkluderer:\r\n- At maskinen blir satt opp med gjeldende utgave av Windows\r\n- Alle nødvendige sikkerhetsinnstillinger og oppdateringer blir automatisk ivaretatt.\r\n- UiB-pålogging, dvs at bruker logger inn på maskinen med sitt vanlige UiB-brukernavn og passord.\r\n- Her må komme noe lab spesifikt https://rts.uib.no/issues/8019\r\n\r\nVi gjør oppmerksom på følgende:\r\n- IT-avdelingens gir ikke støtte på andre oppsett eller versjoner av Windows enn den vi tilbyr\r\n- IT-avdelingen gir dessverre ikke støtte i bruk av selve programvaren. gjelder også lab programvare.\r\n- IT-avdelingen tilbyr bare tjenesten på utstyr kjøpt av UiB i henhold til IT-avdelingens innkjøpsanbefalinger, https://it.uib.no/Innkj%C3%B8psveiledning	plain_text
