node	service	0	75	99	und	0	BRITA tar i mot spørsmål, melding om feil, henvendelser om installasjoner og andre brukerstøtte- eller driftsoppgaver. \r\nBRITA har dessverre ikke kapasitet til å gi brukerstøtte på utstyr og systemer som ikke er satt opp eller driftet av IT-avdelingen. \r\nBRITA gir som regel ikke brukerstøtte med bruk av programvare.\r\n\r\nBrukerstøtte i undervisningsrom blir gitt av IT-assistenter (PC-vakter).\r\n\r\n\r\n\r\nKontakt BRITA\r\nRegistrer henvendelse: https://bs.uib.no / Issue-tracker (krever innlogging)\r\nTelefon internt på UiB: 84700\r\nTelefon fra utenfor UiB: (+47) 55 58 47 00\r\nPersonlig fremmøte for brukerstøtte avtales på forhånd\r\nBesøksadresse: Nygårdsgaten 5, 4. etasje\r\n\r\nÅpningstid: 0800-1545 alle arbeidsdager	plain_text
node	service	0	77	101	und	0	Hva IT-assistentene kan hjelpe deg med:\r\n\r\n- Spørsmål som gjelder bruk av IT i studiene\r\n- Problemer som gjelder PC-stuer, studentskrivere og andre IT-tjenester for studenter\r\n- Tilkobling av privat PC til trådløst nett og utskrift\r\n- Enkel brukerstøtte på Mi Side, Webmail, Sebra, og standard programpakker\r\n- Støtte til PC-er driftet av IT-avdelingen\r\n- Løse eller videreformidle problem i Issue-tracker\r\n- Tilsyn med skrivere (fylle på papir og toner)\r\n- Videreformidle IT-problemer som IT-assistentene ikke kan løse selv\r\n\r\n\r\nHva IT-assistentene ikke kan hjelpe deg med:\r\n\r\n- Privat IT-utstyr, ut over tilkobling til UiB-nett eller bruk av UiBs IT-tjenester\r\n- Gi studieveiledning\r\n- Gi hjelp via telefon\r\n- Spørsmål som ikke har med IT-tjenestene å gjøre, men vet kanskje hvem du kan spørre\r\n- Ting som krever administrator-rettigheter på maskinene\r\n	plain_text
