node	service	0	69	93	und	0	STUDENTER får hjemmekatalog på et lagringsområde på en av IT-avdelingens tjenermaskiner (servere). Det er en begrensning på hvor mye plass du kan bruke på hjemmekatalogen. Hjemmekatalogen kobles automatisk opp når du logger deg på klientmaskiner på UiB. Du kan også koble til hjemmekatalogen fra andre maskiner.\r\n\r\nANSATTE får to hjemmekataloger på IT-avdelingens servere. Den ene brukes som aktivt arbeidsområde. Innholdet av denne er også tilgjengelig (synkronisert) på bærbar Windows klient. Den andre brukes som arkiv og kan ikke synkronisere til bærbar Windows klient. Det er begrensning på hvor mye plass du kan bruke på hjemmekatalogene. Begge hjemmekatalogene kobles automatisk opp når du logger deg på klientmaskiner på UiB. Du kan også koble til begge hjemmekatalogene fra andre maskiner.\r\n\r\nInnholdet på hjemmekataloger sikkerhetskopieres hver natt.	plain_text
