node	service	0	28	28	und	0	UiB tilbyr epost til ansatte og studenter.  Alle med brukerkonto ved UiB er forpliktet til å lese epost sendt til deres adresse ved UiB.  Epost tilbys både fra klientdriftet og selvdriftet utstyr.  Med klientdriftet utstyr settes epost opp automatisk.  Det gis assistanse med oppsett av epost på selvdriftet utstyr og på mobiltelefoner kjøpt av UiB via vanlig brukerstøtte.  For eget utstyr og for utfyllende informasjon om bruk henvises til https://it.uib.no/E-post \r\n\r\nDet opprettes personlig epost-adresse samtidig som det opprettes konto og det er vanlig brukernavn og passord som brukes for å sende og motta epost.  Oppsett av epost-programvare er forskjellig for studenter og ansatte.  Ansatte har tilbud om epost via Outlook med kalender eller bare epost med selvvalgt klient.\r\n\r\nAll epost til og fra UiB scannes grundig etter virus og uønsket reklame, såkalt spam.	plain_text
