node	service	0	79	103	und	0	UiB har flere forskjellige datasett tilgjengelige som åpne data. Felles for de fleste er at det må registreres navn og e-postadresse for å få tilgang til de via en API-nøkkel. Disse dataene er i maskinlesbar form (XML og JSON) og er derfor først og fremst ment for systemer og applikasjoner.	plain_text
node	service	0	13	85	und	0	Ved bestilling av tjenesten får du en egen Wiki-instans, driftet av IT avdelingen. Tjenesten tilbys ansatte og studenter ved fakulteter, institutter, avdelinger og forskningsgrupper ved UIB, og samarbeidspartnere til UiB.\r\n\r\nLes mer her: https://it.uib.no/Wikihost	plain_text
node	service	0	10	10	und	0	Her finner du informasjon om Universitetets studier, forskning og formidling. I tillegg finner du informasjon om organisasjonen, aktiviteter og aktuelle saker.      \r\nRedaktører har tilgang til å publisere innhold. Dersom du trenger tilgang til å redigere/publisere kan du ta kontakt med Sebra-godkjenner ved din enhet.  \r\n\r\nAlle ansatte har anledning til å redigere innhold på sin personside.	plain_text
node	service	0	64	87	und	0	UiB er spredd over et relativt stort geografisk område i Bergen. Alle bygg eid eller leid av UiB knyttes sammen i et datanettverk, som så er knyttet til Uninett/Internett.\r\nFølgende utstyr kan kobles til kablet nettverk:\r\n- Klient datamaskiner og utstyr som er installert og satt opp av IT-avdelingen\r\n- Private og egen driftete datamaskiner via VPN https://tk.app.uib.no/node/63\r\n- Instrument-PC (lab-PC) kan benytte VPN eller Sikkert nettverk for instrument-PC (lab-PC) (Sikkert Nett) https://tk.app.uib.no/node/53\r\n\r\nAv sikkerhetsmessige årsaker er det ikke tillatt å koble trådløse enheter eller andre aksesspunkter til UiB sine nettverk.\r\n\r\nAvdelingene og enhetene må selv skaffe nettverkskabel fra veggpunktet til datamaskinen.\r\n\r\nVær oppmerksom på at BRITA kun tilbyr brukerstøtte til ansatte og utstyr som IT-avdelingen har satt opp.\r\n	plain_text
node	service	0	61	83	und	0	Hvis din datamaskin sprer virus innenfor UiB-nettverket, vil du bli varslet. Når du har mottatt flere advarsler men ikke men ikke foretatt deg noe for å rette opp problemet, vil din VPN-tilkobling bli sterkt begrenset med kun tilgang til nettsider på uib.no.\r\nDu kan sjekke om du er rammet av dette her: https://tjinfo.uib.no/sperret\r\n\r\nMerk at IT-avdelingen ikke tilbyr brukerstøtte eller reinstallasjon av private datamaskiner.\r\nFor UiB eid egen-driftet datamaskiner kan vi tilby reinstallering med ett av våre klientoppsett så lenge kriteriene for dette er oppfylt. \r\n\r\nLinux-klient https://tk.app.uib.no/node/37\r\nWindows-klient https://tk.app.uib.no/node/38\r\nMac-klient https://tk.app.uib.no/node/39	plain_text
node	service	0	65	88	und	0	Når ett program har flytendelisens på sentral lisensserver, betyr det at lisensserveren på UiB styrer hvor mange som kan bruke programmet samtidig. Hvor mange som kan bruke programmet samtidig er bestemt i lisensavtaler med den enkelte programvareleverandør.  \r\n\r\nI utgangspunktet er det ikke noen begrensning på antall programvareinstallasjoner, men flere lisensavtaler er begrenset til en forskergruppe, institutt eller ett fakultet.\r\n\r\nIT-avdelingen anbefaler denne lisensieringstjenesten fordi den ofte er billigere å kjøpe lisenser til en lisensserver i motsetning til å kjøpe enkeltlisenser.	plain_text
node	service	0	57	79	und	0	I noen tilfeller må man oppgi sin e-post for å motta en tilbakemelding, f.eks på nettsider som krever at det oppgis en e-postadresse for å få tilsendt et passord eller lignende. Dessverre kan en slik e-post ofte ligne på spam og kan bli forhindret spamfiltre. \r\nFor å unngå at en slik tilbakemelding skal bli fanget av spam og at din e-postadresse blir lagret for evig bruk av nettstedet, kan denne tjenesten brukes. E-postadressen som lages vil bli oppgitt og sendt deg på e-post innen 20 minutter når at den er bekreftet aktivisert. Adressen vil bare være gyldig i det antall dager du oppgir.	plain_text
node	service	0	80	104	und	0	IT-avdelingen har mye tilgjengelig og tilrettelagt programvare for Windows, Mac og Linux. \r\n\r\nHvilken programvare som tilbys og eventuelle lisenskostnader  er avhengig av flere ting og kombinasjoner av disse:\r\n- Operativsystem (Windows, Linux, Mac)\r\n- Type lisensiering\r\n- Installert av IT-avdelingen (klientdriftet)\r\n- UiB eid maskin\r\n- Privat maskin\r\n- Ansatt\r\n- Student\r\n- Ansatt i randsonen\r\n\r\n\r\nHer finner du mer detaljert informasjon om programvare:\r\nhttps://it.uib.no/Programvare	plain_text
