3420	Med OpenID-modulen kan brukere logge inn ved hjelp av OpenID-tjenesten. <a href="@openid-net">OpenID</a> gir sikker innlogging på mange nettsted med ett enkelt brukernavn og passord. Det krever ikke spesiell programvare, og deler ikke passord med noen av de tilknyttede nettstedene, heller ikke nettsted man logger inn på. Den viktigste fordelen for brukerne er at de enkelt kan oppdatere passord på ett sentralt sted, i stedet for å måtte forandre dusinvis av passord hver for seg. Les mer om <a href="@handbook">OpenID-modulen i håndboka</a>.	nb	0	0	0
3421	Logger på med OpenID	nb	0	0	0
3422	For å logge inn med OpenID må man ha en OpenID-konto fra før. Folk som har det kan opprette konto her med OpenID-en sin, knytte en eller flere OpenID-er til en eksisterende brukerkonto, og logge inn med OpenID. Dette senker terskelen for å opprett bruker, noe som kan bidra til å øke antall brukere. Det er også praktisk og sikkert for brukerne. OpenID kan ikke garantere at en bruker er gyldig, så bekreftelse over e-post er fremdeles nødvendig. Ved innlogging får brukerne beskjed om å oppgi OpenID-URL-en sin, som er på formen <em>mittbrukernavn.openidleverandør.com</em>. Nettstedet kommuniserer så med OpenID-tjeneren, og ber den bekrefte identiteten til brukeren. Hvis han/hun er logget inn på OpenID-tjeneren sin vil den kommunisere tilbake til nettstedet ditt med bekreftelse. Hvis brukeren ikke er logget inn vil OpenID-tjeneren spørre brukeren om passord. Nettstedet ditt vil ikke på noe tidspunkt registrere OpenID-passordet til brukeren.	nb	0	0	0
